export default function MeterWidgetH(props) {
    // Declare a new state variable, which we'll call "count"

    let bars = "";
    let position = 0;
    for ( let i=1;i<11;i++){
        switch (i){
            case (i<5):
                position = 2 + (i-1)*6;
                bars+='<g fill=\"none\" stroke=\"green\" stroke-width=\"4\"><path d=\"M 2 12 l 0 12\"/></g>';
                break;
            case (i===5):
                position = 2 + (i-1)*6;
                bars+='<g fill=\"none\" stroke=\"green\" stroke-width=\"4\"><path d=\"M 2 12 l 0 12\"/></g>';
                break;
            case (i>5):
                position = 2 + ( i-1)*6;
                bars+='<g fill=\"none\" stroke=\"green\" stroke-width=\"4\"><path d=\"M 2 12 l 0 12\"/></g>';
                break;
        }
    }

    console.log(bars);

    return (


        <div className="flex flex-row ">
            <div className="m-1 rounded-md">

                <div className="flex flex-row">
                    <div className="text-TDRedHighlight text-sm font-medium">
                        {props.fromTitle}
                    </div>
                    <div className="px-1 pt-1">
                        <svg height="16" width="58">
                            <g fill="none" stroke="green" stroke-width="4"><path d="M 2 12 l 0 12"/></g>




                        </svg>

                    </div>
                    <div className="text-TDGreenHighlight text-sm font-medium">
                        {props.toTitle}
                    </div>

                </div>
            </div>


        </div>






    );
}
